    false,nt"url": null,nt"notes": "This annual narrative report for Rachel
    Carson National Wildlife Refuge outlines Refuge accomplishments during the 1992
    calendar year. The report begins with a summary of the year's  highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which focused on the master plan. Refuge administration is outlined; information
    about personnel, the volunteer program, funding and safety is covered. Habitat management
    is also covered; subjects include wetlands, forests, grasslands, and fire management.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    other migratory birds, game mammals, marine mammals, and fisheries resources. The
    public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation,
    major maintenance, equipment utilization and replacement, communication systems,
    and computer systems.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
